import React from "react";
import Card from './components/Card';

class App extends React.Component {
  render() {
  return (
    <main>
      <h1>Conteudo</h1>
      <p>Acesse agenda aqui</p>

      <Card />
      <Card />
    </main>
  );
  }
}

export default App;
